def translating_rna_into_protein(dna_string):
    n = 0
    while (n < (len(dna_string)-2)):
        if (dna_string[n:n+3] in RNA_codon_table):
            codon = RNA_codon_table[dna_string[n:n+3]]
            if codon != "Stop": 
                print(RNA_codon_table[dna_string[n:n+3]], end="")
            n = n+3
            
